('http://www.lolita.pf', '[LoLiTa : Logiciels Libres à Tahiti et dans les îles]', 'L&#39;association LoLiTa a pour objet la promotion, l&#39;aide au d&#233;ploiement et le d&#233;veloppement en Polyn&#233;sie fran&#231;aise des logiciels libres, open source et/ou alternatifs en g&#233;n&#233;ral et du syst&#232;me d&#39;exploitation GNU /Linux en particulier. Elle soutient le projet FenuaSoft une compilation de Logiciels Libres cr&#233;&#233;e sur le Fenua, pour le Fenua. Ce projet a pris la forme d&#39;un c&#233;d&#233;rom qui contient 40 logiciels pour PC. En m&#234;me temps, une version est consultable sur internet et h&#233;berg&#233;e &#224; Tahiti. La page d&#39;accueil du site de l&#39;association pr&#233;sente les articles de r&#233;dacteurs b&#233;n&#233;voles de Tahiti et des &#238;les, du plus r&#233;cent au plus ancien. Pour &#234;tre tenu au courant de nos actions vous pouvez vous inscrire &#224; notre lettre d&#39;information ou vous abonner au fil rss. Le logiciel libre c&#39;est une id&#233;e g&#233;n&#233;reuse, des solutions techniques r&#233;alistes et efficaces, un forum local pour poser vos questions simples ou complexes. Ne restez pas seul dans votre coin, soutenez-nous en nous rejoignant ! Recevez de nos nouvelles en vous inscrivant &#224; notre lettre d&#39;information', 'Sur le web,L&#39;association LoLiTa ,L&#39;atelier des linuxiens,D&#233;butants,L&#233;gislation,Le Libre en Polyn&#233;sie,Le Libre ailleurs,test rubrique'),
